import React from 'react';
import './MessageDetail.css';

function MessageDetail({ message }) {
  if (!message) {
    return <div>No message selected</div>;
  }

  return (
    <div className="message-detail-container">
      <p className="message-detail-text">Message No: {message.message_no}</p>
      <p className="message-detail-text">Content: {message.message_content}</p>
      <p className="message-detail-text">Send Date: {message.send_date}</p>
      <p className="message-detail-text">Sender No: {message.sender_no}</p>
      <p className="message-detail-text">Receiver No: {message.receiver_no}</p>
      <p className="message-detail-text">Member No: {message.member_no}</p>
    </div>
  );
}

export default MessageDetail;
